import { Route } from "react-router-dom";
import Home from "../components/Page/Home/Home"

function MainRoutes(){
    return (
        <>
        <Route path="/" element={<Home/>}/>
        <Route path="/headers" element={<Headers/>}/>
        </>
    )
}

export default MainRoutes;
